/*Table structure for table `administrator` */

DROP TABLE IF EXISTS `administrator`;

CREATE TABLE `administrator` (
  `ADMI_ID` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '管理员ID',
  `ADMI_PHONE` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号',
  `ADMI_PASSWORD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '密码',
  `ADMI_PORTRAIT` mediumblob COMMENT '管理员头像',
  `ADMI_NAME` varchar(30) DEFAULT NULL COMMENT '管理员名字',
  `ADMI_EMAIL` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `ADMI_STATE` int(3) DEFAULT NULL COMMENT '登录状态',
  `ADMI_CRETIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`ADMI_ID`),
  KEY `ADMI_ID` (`ADMI_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

