/*Table structure for table `customer` */

DROP TABLE IF EXISTS `customer`;

CREATE TABLE `customer` (
  `id` varchar(32) NOT NULL COMMENT '服务商id',
  `name` varchar(16) DEFAULT NULL COMMENT '名称',
  `provider_info_user` varchar(1024) DEFAULT NULL COMMENT '服务简介（管理员）',
  `provider_info_member` varchar(1024) DEFAULT NULL COMMENT '服务简介（会员）',
  `cellphone` varchar(16) DEFAULT NULL COMMENT '手机号',
  `password` varchar(128) DEFAULT NULL COMMENT '密码',
  `provider_img` varchar(64) DEFAULT NULL COMMENT '服务商头像',
  `region` varchar(32) DEFAULT NULL COMMENT '地区',
  `wechat` varchar(16) DEFAULT NULL COMMENT '微信号',
  `qq` varchar(16) DEFAULT NULL COMMENT 'QQ号',
  `email` varchar(64) DEFAULT NULL COMMENT '邮箱',
  `auth_file` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '营业执照',
  `work_time` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '工作时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `tel` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '客服电话',
  `recommend` int(22) DEFAULT NULL COMMENT '是否推荐服务商（1：是 2：否）',
  `status` int(22) DEFAULT NULL COMMENT '状态（1：正常 2：停用）',
  `province` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '省',
  `city` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '城市',
  `area` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '地区',
  `province_img` mediumblob COMMENT '图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `customer` */

/*Table structure for table `customers` */

DROP TABLE IF EXISTS `customers`;

CREATE TABLE `customers` (
  `CUST_ID` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '用户id',
  `CUST_NAME` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '用户名',
  `CUST_PORTRAIT` mediumblob COMMENT '头像',
  `CUST_SEX` varchar(3) DEFAULT NULL COMMENT '性别',
  `CUST_PHONE` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '手机号',
  `CUST_REGION` varchar(6) DEFAULT NULL COMMENT '所在地',
  `CUST_STARTTIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `CUST_EMAIL` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '邮箱',
  `CUST_NUMBER` int(9) DEFAULT NULL COMMENT '购买订单数',
  `CUST_PRICE` int(9) DEFAULT NULL COMMENT '消费金额',
  `CUST_STATE` int(3) DEFAULT '0' COMMENT '登录状态（1已登录/ 0未登录）',
  `CUST_PASSWORD` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '密码',
  PRIMARY KEY (`CUST_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

