/*Table structure for table `service` */

DROP TABLE IF EXISTS `service`;

CREATE TABLE `service` (
  `id` varchar(32) NOT NULL COMMENT '会员id',
  `name` varchar(16) DEFAULT NULL COMMENT '会员名称',
  `gender` int(22) DEFAULT NULL COMMENT '性别（1：男 2：女）',
  `cellphone` varchar(16) DEFAULT NULL COMMENT '手机号',
  `head_img` varchar(64) DEFAULT NULL COMMENT '头像',
  `password` varchar(128) DEFAULT NULL COMMENT '密码',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `email` varchar(128) DEFAULT NULL COMMENT '邮箱',
  `province` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '省',
  `city` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '城市',
  `area` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '地区',
  `order_num` int(24) DEFAULT NULL COMMENT '购买订单数',
  `order_sum` int(24) DEFAULT NULL COMMENT '消费金额',
  `status` int(22) DEFAULT NULL COMMENT '状态（1：已登录 2：未登录）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `service` */

/*Table structure for table `serviceproduct` */

DROP TABLE IF EXISTS `serviceproduct`;

CREATE TABLE `serviceproduct` (
  `SERV_PRODUCTID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '服务产品id',
  `SERV_PROVIDERID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '服务商id',
  `SERV_PRODUCTIMG` mediumblob COMMENT '服务产品图片',
  `SERV_PRODUCTNAME` varchar(256) DEFAULT NULL COMMENT '服务名称',
  `SERV_INSTRUCTIONS` varchar(512) DEFAULT NULL COMMENT '服务说明',
  `SERV_PRICE` int(9) DEFAULT NULL COMMENT '服务价格',
  `SERV_STARTTIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `SERV_STATE` int(3) DEFAULT '1' COMMENT '服务状态',
  `SERV_BUMBER` int(9) DEFAULT '0' COMMENT '销量',
  `SERV_PROVIDERNAME` varchar(60) DEFAULT NULL COMMENT '服务商名称',
  `SERV_RECOMMENDED` int(3) DEFAULT NULL COMMENT '推荐',
  `SERV_NECESSARY` int(3) DEFAULT NULL COMMENT '初创必备',
  PRIMARY KEY (`SERV_PRODUCTID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

