/*Table structure for table `serviceprovider` */

DROP TABLE IF EXISTS `serviceprovider`;

CREATE TABLE `serviceprovider` (
  `SERV_PROVIDER_ID` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '服务商用户ID',
  `SERV_PROVIDER_IMG` mediumblob COMMENT '服务商头像',
  `SERV_PROVIDER_NAME` varchar(60) DEFAULT NULL COMMENT '服务商名称',
  `SERV_PROVIDER_REGION` varchar(6) DEFAULT NULL COMMENT '服务商地区',
  `SERV_PROVIDER_PHONE` varchar(11) DEFAULT NULL COMMENT '服务商电话',
  `SERV_PROVIDER_PASSWORD` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '服务商密码',
  `SERV_PROVIDER_STATE` int(3) DEFAULT '1' COMMENT '服务商登录状态',
  `SERV_PROVIDER_INTRODUCTION` varchar(256) DEFAULT NULL COMMENT '管理员看服务商简介',
  `SERV_PROVIDER_EMAIL` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `SERV_PROVIDER_STARTTIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `SERV_COMPANY_INTRDUCTION` varchar(256) DEFAULT NULL COMMENT '顾客看服务商简介',
  `SERV_PROVIDER_WORKTIME` varchar(20) DEFAULT NULL COMMENT '工作时间',
  `SERV_PROVIDER_QQ` varchar(11) DEFAULT NULL COMMENT 'QQ',
  `SERV_PROVIDER_WEICHART` varchar(20) DEFAULT NULL COMMENT '微信',
  `SERV_PROVIDER_CSPHONE` varchar(11) DEFAULT NULL COMMENT '客服电话',
  `SERV_PROVIDER_BUSINESSLICENSE` mediumblob COMMENT '营业执照',
  PRIMARY KEY (`SERV_PROVIDER_ID`)
